	/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
	
	
	/**
	 * to change the color of a given region
	 * @param region
	 * @param color
	 */
	public static void colorRegion (SVGPath region, Color color){
		 region.setOpacity(1.0);
		 region.setFill(color);	
	}
	
	
	/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
	
	
	/**
	 * to fill the region with an image
	 * @param region
	 * @param img
	 */
	public static void fillImage(SVGPath region, Image img){
		region.setFill(new ImagePattern(img));
	}
	
	
	/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
	
	
	/**
	 * to add marker/flag to a given coordinates on the map
	 * @param img
	 * @param imgWidth
	 * @param imgHeight
	 * @param x
	 * @param y
	 * @param id
	 * @return iv
	 */
	public static ImageView marker(Image img, double imgWidth, double imgHeight, double x, double y, String id){
		ImageView iv = new ImageView(img);
		iv.setManaged(false);
		iv.setFitHeight(imgHeight);
		iv.setFitWidth(imgWidth);
		iv.setId(id);
		iv.translateXProperty().bind(scene.widthProperty().divide(scene.getWidth()/x));
		iv.translateYProperty().bind(scene.heightProperty().divide(scene.getHeight()/y));
		iv.scaleXProperty().bind(scene.widthProperty().divide(scene.getWidth()));
		iv.scaleYProperty().bind(scene.heightProperty().divide(scene.getHeight()));
		return iv;
	}
	
	
	/////////////////////////////////////////////////////////////////////////////////////////////////////////////////
	
	
	/**
	 * to add special effect to a given region
	 * @param region
	 * @param color
	 */
	public static void setEffectToRegion(SVGPath region, Color color){
	    DropShadow borderGlow = new DropShadow();
	    borderGlow.setOffsetY(0f);
	    borderGlow.setOffsetX(0f);
	    borderGlow.setColor(color);
	    borderGlow.setWidth(15);
	    borderGlow.setHeight(15); 
	    region.setEffect(borderGlow);
	}


